import React from "react";
import swapy from "../src/Photo/img1.jpeg";
import { NavLink } from "react-router-dom";
import Common from "./Common";

const Home = () => {
    return (
        <>
            <Common
                name="Grow your Business with "
                imgsrc={web}
                visit="/Services"
                btname="Get Started" />

        </>
    );
};

export default Home;
